import React from 'react'
import { UserContext } from '../../UserContext'

function Contact() {
    const User = useContext(UserContext);
    const [Details, setDetails] = useState(User)
    const submitHandeler = () => {

    }
    return (
        <>
            <div className="title">
                <h4>User Information</h4>
            </div>
            <form onSubmit={submitHandeler}>
                <div className="form-group-material">
                    <input id="email" type="text" name="Email" value={Details.email} onChange={(e) => setDetails({ ...Details, email: e.target.value })} className="input-material" />
                    <label htmlFor="email" className={Details.email ? "label-material active" : "label-material"}>Email address</label>
                </div>
                <div className="form-group-material">
                    <input id="phone" type="text" name="Phone" value={Details.phone} onChange={(e) => setDetails({ ...Details, phone: e.target.value })} className="input-material" />
                    <label htmlFor="phone" className={Details.phone ? "label-material active" : "label-material"}>Contact number</label>
                </div>
            </form>
        </>
    )
}

export default Contact
